import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

// Components
import Navbar from './components/Navbar';
import PrivateRoute from './components/PrivateRoute';

// Pages
import Home from './pages/Home';
import Login from './pages/Login';
import Register from './pages/Register';
import Profile from './pages/Profile';
import Article from './pages/Article';
import KnowledgeBase from './pages/KnowledgeBase';
import Analytics from './pages/Analytics';
import Recommendations from './pages/Recommendations';
import ReadingHistory from './pages/ReadingHistory';
import Bookmarks from './pages/Bookmarks';
import AdminDashboard from './pages/AdminDashboard';
import AdminArticleForm from './pages/AdminArticleForm';
import ExternalArticle from './pages/ExternalArticle';
import { useTheme } from './hooks/useTheme';

function App() {
  const { theme } = useTheme();
  const isDark = theme === 'dark';
  const gradientStyle = !isDark
    ? { background: 'linear-gradient(135deg, #e0eafc 0%, #cfdef3 100%)', minHeight: '100vh', width: '100vw' }
    : {};

  return (
    <Router>
      <div className={(isDark ? 'bg-gray-900 min-h-screen w-full' : 'min-h-screen w-full')} style={gradientStyle}>
        <Navbar />
        <main className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />
            <Route
              path="/profile"
              element={
                <PrivateRoute>
                  <Profile />
                </PrivateRoute>
              }
            />
            <Route
              path="/article/:id"
              element={
                <PrivateRoute>
                  <Article />
                </PrivateRoute>
              }
            />
            <Route
              path="/knowledge-base"
              element={
                <PrivateRoute>
                  <KnowledgeBase />
                </PrivateRoute>
              }
            />
            <Route
              path="/analytics"
              element={
                <PrivateRoute>
                  <Analytics />
                </PrivateRoute>
              }
            />
            <Route
              path="/recommendations"
              element={
                <PrivateRoute>
                  <Recommendations />
                </PrivateRoute>
              }
            />
            <Route
              path="/history"
              element={
                <PrivateRoute>
                  <ReadingHistory />
                </PrivateRoute>
              }
            />
            <Route
              path="/bookmarks"
              element={
                <PrivateRoute>
                  <Bookmarks />
                </PrivateRoute>
              }
            />
            <Route
              path="/admin"
              element={
                <PrivateRoute>
                  <AdminDashboard />
                </PrivateRoute>
              }
            />
            <Route
              path="/admin/new"
              element={
                <PrivateRoute>
                  <AdminArticleForm />
                </PrivateRoute>
              }
            />
            <Route
              path="/admin/edit/:id"
              element={
                <PrivateRoute>
                  <AdminArticleForm />
                </PrivateRoute>
              }
            />
            <Route path="/external-article" element={<ExternalArticle />} />
          </Routes>
        </main>
        <ToastContainer position="bottom-right" />
      </div>
    </Router>
  );
}

export default App;
